<!DOCTYPE html>
<html lang="en">

<head>
    <title>Document</title>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <link rel="stylesheet" href="/icomoon/main.css">
    <link rel="stylesheet" href="/main.css">
    <script src="/lib/paper-full.min.js"></script>
    <script src="/failed/paper-patch.js"></script>
    <script src="/failed/selection.js"></script>
    <script src="/failed/util.js"></script>
    <script src="/failed/shape.js"></script>
    <script src="/failed/path.js"></script>
    <script src="/failed/group.js"></script>
    <script src="/failed/instance.js"></script>
    <script src="/failed/tools.js"></script>
    <script src="/failed/operator.js"></script>
    <script src="/failed/tree.js"></script>
    <script src="/failed/other.js"></script>
    <script src="/failed/app.js"></script>
</head>

<body>
    <div class="Toolbar">
        <div class="picker" title="hello">
            <div class="picker icon-compass" name="picker"></div>
        </div>
        <div class="shape">
            <div class="line icon-flow-line" name="line"></div>
            <div class="rect icon-square2" name="rect"></div>
            <div class="mutiShape icon-star-empty" name="mutiShape"></div>
        </div>
        <div class="path">
            <div class="pen icon-pen" name="pen"></div>
            <div class="pencil icon-pencil" name="pencil"></div>
        </div>
        <div class="text">
            <div class="text icon-font" name="text"></div>
        </div>
        <div class="modifier">
            <div class="mirror icon-page-break" name="mirror"></div>
            <div class="rotate icon-redo" name="rotate"></div>
        </div>
    </div>
    <div class="main">
        <div class="Tree"></div>
        <div class="Workspace"></div>
        <div class="Inspector"></div>
    </div>
</body>

</html>
